import { useState } from "react";

const Home = () => {
  const [fetched, setFetched] = useState(null);

  fetch("http://localhost:8000/todos")
    .then((res) => res.json())
    .then((data) => setFetched(data));

  return <div className="show-to-do"></div>;
};

export default Home;
